import { Route, Routes } from "react-router-dom";

import Signin from "./Components/Pages/Signin";
import Signup from "./Components/Pages/Signup";
import Home from "./Components/Pages/Home";
import ProjectsPath from "./Components/Pages/Projects/ProjectsPaths";
import Projects from "./Components/Pages/Projects/AllProjects";
import Scrollup from "./Components/Scrollup";

import "./App.css";
import { ToastContainer } from "react-toastify";
import UserProjects from "./Components/Pages/Projects/ProjectCRUD/UserProjects";
import AddProject from "./Components/Pages/Projects/ProjectCRUD/AddProject";
import UpdateProject from "./Components/Pages/Projects/ProjectCRUD/UpdateProject";



function App() {
  return (
    <div className="app">
      <ToastContainer />
      <Routes>
        <Route exact path="/" element={<Home />} />
        <Route exact path="/signin" element={<Signin />} />
        <Route exact path="/signup" element={<Signup />} />
        <Route exact path="/projects" element={<Projects />} />
        <Route exact path="/projects" element={<ProjectsPath />} />
        <Route exact path="/projects/:type" element={<Projects />} />
        <Route exact path="/myprojects" element={<UserProjects />} />
        <Route exact path="/myprojects/add" element={<AddProject />} />
        <Route exact path="/myprojects/edit/:id" element={<UpdateProject />} />
      </Routes>
      <Scrollup />
    </div>
  );
}

export default App;
